// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Migrations {
    address public owner = msg.sender;
    uint256 public last_completed_migration;
    event Tweeted(address from, string time);
    mapping(uint256 => address) users;
    uint256 counter = 0;
    struct Tweet {
        uint256 id;
        string tweet;
        address[] reweet;
        string image;
        uint256 time;
        address user_id;
    }

    struct User {
        address id;
        string name;
        address[] follows;
    }
    Tweet[] tweets;
    User[] usersArray;

    modifier restricted() {
        require(
            msg.sender == owner,
            "This function is restricted to the contract's owner"
        );
        _;
    }

    function setCompleted(uint256 completed) public restricted {
        last_completed_migration = completed;
    }

    function addTweet(string memory tweetmsg, string memory imageurl) external {
        Tweet memory newtweek = Tweet({
            id: counter,
            tweet: tweetmsg,
            user_id: msg.sender,
            image: imageurl,
            reweet: new address[](0),
            time: block.timestamp
        });
        counter++;
        tweets.push(newtweek);
    }

    function Retweet() external {
        for (uint256 index = 0; index < counter; index++) {
            if (tweets[index].user_id == msg.sender) {
                tweets[index].reweet.push(msg.sender);
                return;
            }
        }
    }

    function Follow(address follower) external {
        for (uint256 index = 0; index < usersArray.length; index++) {
            if (usersArray[index].id == msg.sender) {
                usersArray[index].follows.push(follower);
            }
        }
    }

